import styled from "styled-components";

const MainRoomNamePresenter = styled.div`
    width: 100%;
    height: 70px;

    display: flex;
    align-items: center;
    justify-content: space-between;

    color:white;
    font-size:20px;
    vertical-align: middle;
    padding-left:20px;
    padding-right:20px;
    border-bottom: solid 1px #FFFFFF;
`

export default MainRoomNamePresenter;
